import React from 'react';
import styles from './Select.module.css'
import ButtonHeader from '../UI/button/ButtonHeader/ButtonHeader';

const Select = () => {
    return (
        <select className={styles.select__container}>
            <ButtonHeader na/>
            <option className={styles.select__option} selected>
                ЭТО СЕЛЕКТ 1
            </option>
            <option>
                ЭТО СЕЛЕКТ 2
            </option>
        </select>
    );
};

export default Select;
